import React from 'react';

const CardList =({robot_cardList})=>
{
	return(
		<div className='tc bg-light-pink dib br3 pa3 ma2 grow bw2 shadow-5'>
		<img src={`https://robohash.org/${robot_cardList[0].id}?size=200x200`}/>

		  <div>
		  	  <h2>{robot_cardList[0].name}</h2>
  	  	 	  <p>{robot_cardList[0].email}</p>
		  </div>

		</div>


		);
} 

export default CardList;
